import React from "react";

export default function PersonalInfoInput() {
  return (
    <form>
      <lable htmlFor="name">Name:</lable>
      <input type="text" placeholder="Enter Name" id="name" />
      <lable htmlFor="email">Email:</lable>
      <input type="email" placeholder="Enter Email" id="email" />
      <lable htmlFor="number">Contacts:</lable>
      <input type="number" placeholder="Enter Phone Number" id="number" />
      <lable htmlFor="linkedin">Name:</lable>
      <input type="text" placeholder="Enter Pnone Number" id="linkedin" />
    </form>
  );
}
